import React from 'react';

const Contact = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >


      <div className="formlh">
      <h4>Để lại tin nhắn cho chúng tôi </h4>
      <div class="col">
    <input type="text" class="form-control" placeholder="Họ tên" aria-label="First name"/>
  </div>
  <br />
  <div class="col">
    <input type="text" class="form-control" placeholder="Điện thoại" aria-label="First name"/>
  </div>
  <br />
      <div class="mb-3">
  <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="Địa chỉ mail"/>
</div>
<div class="mb-3">
  <textarea class="form-control" id="exampleFormControlTextarea1" rows="3" placeholder="Lời nhắn"></textarea>
</div>
      </div>
    </div>
  );
};

export default Contact;
